import React from 'react';
import styled from 'styled-components';

const TableContainer = styled.div`
  margin: 20px 0;
`;

const Table = styled.table`
  width: 100%;
  border-collapse: collapse;
  background-color: #333;
  color: #fff;
`;

const TableHeader = styled.th`
  padding: 10px;
  border-bottom: 2px solid #444;
`;

const TableData = styled.td`
  padding: 10px;
  border-bottom: 1px solid #444;
`;

const Button = styled.button`
  background-color: ${({ theme }) => theme.primaryButton};
  color: #000;
  border: none;
  padding: 10px 15px;
  font-size: 16px;
  cursor: pointer;
  margin-bottom: 20px;

  &:hover {
    background-color: #e0a800;
  }
`;

const OrdersTable = ({ orders, handleDelete }) => {
  return (
    <TableContainer>
      <Button>Nueva Orden</Button> {/* Botón para agregar nueva orden */}
      <Table>
        <thead>
          <tr>
            <TableHeader>ID</TableHeader>
            <TableHeader>Nombre</TableHeader>
            <TableHeader>Descripción</TableHeader>
            <TableHeader>Acciones</TableHeader>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr key={order.id}>
              <TableData>{order.id}</TableData>
              <TableData>{order.name}</TableData>
              <TableData>{order.description}</TableData>
              <TableData>
                <button onClick={() => handleDelete(order.id)}>Eliminar</button>
              </TableData>
            </tr>
          ))}
        </tbody>
      </Table>
    </TableContainer>
  );
};

export default OrdersTable;
